A metric type implementation is defined in its own file under glean-core/src/metrics/ , e.g. glean-core/src/metrics/counter.rs for a Counter . Start by defining a structure to hold the metric's metadata: #[derive(Debug)]
pub struct CounterMetric { meta: CommonMetricData
} Implement the MetricType trait to create a metric from the meta data as well as expose the meta data. This also gives you a should_record method on the metric type. impl MetricType for CounterMetric { fn with_meta(meta: CommonMetricData) -> Self { Self { meta } } fn meta(&self) -> &CommonMetricData { &self.meta }
} Its implementation should have a way to create a new metric from the common metric data. It should be the same for all metric types. impl CounterMetric { pub fn new(meta: CommonMetricData) -> Self { Self { meta } }
} Implement each method for the type. The first argument to accept should always be glean: &Glean , that is: a reference to the Glean object, used to access the storage: impl CounterMetric { // same block as above pub fn add(&self, glean: &Glean, amount: i32) { // Always include this check! if !self.should_record() { return; } // Do error handling here glean .storage() .record_with(&self.meta, |old_value| match old_value { Some(Metric::Counter(old_value)) => Metric::Counter(old_value + amount), _ => Metric::Counter(amount), }) }
} Use glean.storage().record() to record a fixed value or glean.storage.record_with() to construct a new value from the currently stored one. The storage operation makes use of the metric's variant of the Metric enumeration.

