Persistence and in-memory serialization as well as ping payload serialization are handled through the Metric enumeration. This is defined in glean-core/src/metrics/mod.rs . Variants of this enumeration are used in the storage implementation of the metric type. To add a new metric type, include the metric module and declare its use, then add a new variant to the Metric enum: mod counter; // ... pub use self::counter::CounterMetric; #[derive(Serialize, Deserialize, Debug, Clone)]
pub enum Metric { // ... Counter(i32),
} Then modify the below implementation and define the right category name for the new type. This will be used in the ping payload: impl Metric { pub fn category(&self) -> &'static str { match self { // ... Metric::Counter(_) => "counter", } }
} Finally, define the ping payload serialization (as JSON). In the simple cases where the in-memory representation maps to its JSON representation it is enough to call the json! macro. impl Metric { // same block as above pub fn as_json(&self) -> JsonValue { match self { // ... Metric::Counter(c) => json!(c), } }
} For more complex serialization consider implementing serialization logic as a function returning a serde_json::Value or another object that can be serialized.

