The FFI component implementation can be found in glean-core/ffi/src/lib.rs . Add a global map for your metric type: lazy_static! { static ref COUNTER_METRICS: ConcurrentHandleMap<CounterMetric> = ConcurrentHandleMap::new();
} Add a function to create new instances of this metric type: #[no_mangle]
pub extern "C" fn glean_new_counter_metric( category: FfiStr, name: FfiStr, send_in_pings: RawStringArray, send_in_pings_len: i32, lifetime: i32, disabled: u8,
) -> u64 { COUNTER_METRICS.insert_with_log(|| { let send_in_pings = unsafe { from_raw_string_array(send_in_pings, send_in_pings_len) }; let lifetime = Lifetime::try_from(lifetime)?; Ok(CounterMetric::new(CommonMetricData { name: name.into_string(), category: category.into_string(), send_in_pings, lifetime, disabled: disabled != 0, })) })
} On the Rust side add wrappers around the metric type's storage functions: #[no_mangle]
pub extern "C" fn glean_counter_add(glean_handle: u64, metric_id: u64, amount: i32) { GLEAN.call_infallible(glean_handle, |glean| { COUNTER_METRICS.call_infallible(metric_id, |metric| { metric.add(glean, amount); }) })
} Additionally, expose the should_record function: #[no_mangle]
pub extern "C" fn glean_counter_should_record(glean_handle: u64, metric_id: u64) -> u8 { GLEAN.call_infallible(glean_handle, |glean| { COUNTER_METRICS.call_infallible(metric_id, |metric| metric.should_record(&glean)) })
}

