The platform-specific FFI wrapper needs the definitions of these new functions. For Kotlin this is in glean-core/android/src/main/java/mozilla/telemetry/glean/rust/LibGleanFFI.kt : fun glean_new_counter_metric(category: String, name: String, send_in_pings: StringArray, send_in_pings_len: Int, lifetime: Int, disabled: Byte): Long
fun glean_counter_add(glean_handle: Long, metric_id: Long, amount: Int)
fun glean_counter_should_record(glean_handle: Long, metric_id: Long): Byte Finally, create a platform-specific metric type wrapper. For Kotlin this would be glean-core/android/src/main/java/mozilla/telemetry/glean/private/CounterMetricType.kt : class CounterMetricType( disabled: Boolean, category: String, lifetime: Lifetime, name: String, val sendInPings: List<String>
) { private var handle: Long init { println("New Counter: $category.$name") val ffiPingsList = StringArray(sendInPings.toTypedArray(), "utf-8") this.handle = LibGleanFFI.INSTANCE.glean_new_counter_metric( category = category, name = name, send_in_pings = ffiPingsList, send_in_pings_len = sendInPings.size, lifetime = lifetime.ordinal, disabled = disabled.toByte()) } protected fun finalize() { if (this.handle != 0L) { val error = RustError.ByReference() LibGleanFFI.INSTANCE.glean_destroy_counter_metric(this.handle, error) } } fun shouldRecord(): Boolean { // Don't record metrics if we aren't initialized if (!Glean.isInitialized()) { return false } return LibGleanFFI.INSTANCE.glean_counter_should_record(Glean.handle, this.handle).toBoolean() } fun add(amount: Int = 1) { if (!shouldRecord()) { return } @Suppress("EXPERIMENTAL_API_USAGE") Dispatchers.API.launch { LibGleanFFI.INSTANCE.glean_counter_add( Glean.handle, this@CounterMetricType.handle, amount) } }
}
